(function(){document.addEventListener("DOMContentLoaded",function(){var w=document.createTreeWalker(document,132,null,false),n=[],c;while(w.nextNode())n.push(w.currentNode);for(var i=0;i<n.length;i++){c=n[i];if(c.nodeType===8){c.parentNode.removeChild(c)}else if(c.nodeType===3){if(!/\S/.test(c.nodeValue)){c.parentNode.removeChild(c)}else{c.nodeValue=c.nodeValue.replace(/\s+/g," ")}}}})})();
